import React , { useState , useEffect} from 'react'
import './index.css'

const url = 'https://api.dotpe.in/api/catalog/store/1/menu?mDomain=fryerstory.in&saletype=delivery&serviceSubtype=delivery';

export const App = () => {
    const [menuitems , setmenuintems] = useState([]);

    const getdishes = async () =>
    {
      const response = await fetch(url);
      const menuitems = await response.json();
      console.log(menuitems);
      setmenuintems(menuitems);
    }

    useEffect(() => {
      getdishes();
    } , []);

    return(
      <>
        <h2>menu items</h2>
        <ul>
          {menuitems.map((item) => {
            return(
              <li>
                <span>{item.menuItems.itemName}</span>
              </li>
            );
          })}
        </ul>
      </>
    );
  }

export default App
